  [],\n\t\"revision_timestamp\": \"2016-08-04T08:17:50.465553\",\n\t\"name\": \"arctic-national-wildlife-refuge-annual-narrative-report-calendar-year-1979\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arctic NWR outlines
  Refuge accomplishments during the 1979 calendar year. The report begins with an
  introduction to the Refuge and information about weather conditions, habitat conditions,
  land acquisition activities, and the system status. Construction and maintenance
  are also described. Habitat management is covered; wilderness areas are discussed.
  The wildlife section of the report discusses endangered and threatened species,
  migratory birds, mammals, non-migratory birds, and grizzly bears, muskox, moose,
  Dall sheep, caribou, polar bears, and wolves. Interpretation and recreation activities
  are outlined; topics include information and interpretation, recreation, and law
  enforcement. Field investigations, cooperative programs, items of interest, and
  safety information are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
